import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import AICoach from '../components/AICoach';

const AICoachPage = () => {
  return (
    <>
      <Header />
      <AICoach />
      <Footer />
    </>
  );
};

export default AICoachPage;
